    useEffect(()=>{

        (async ()=>{
          try {
              const {data:{books}}= await axios.get("data.json");
              console.log(books);
          } catch (error) {
              console.log(error);
          }
        })()


    },[])
    return (<Navbar/>)
            //<productCart/>)
}
